import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import {
  faHtml5,
  faCss3Alt,
  faSass,
  faJsSquare,
  faGithubSquare,
  faReact,
  faJava,
} from "@fortawesome/free-brands-svg-icons";
import styles from "./SkillsList.module.scss";
import spring from "../../styles/spring.svg";

export const SkillsList = () => {
  return (
    <div className={styles.skills}>
      <div className={styles.skills__icon}>
        <FontAwesomeIcon
          icon={faHtml5}
          size="2x"
          className={styles.skills__icon_shadow}
        />
      </div>
      <div className={styles.skills__icon_list}>
        <FontAwesomeIcon icon={faCss3Alt} size="2x"
        />
      </div>
      <div className={styles.skills__icon_list}>
        <FontAwesomeIcon icon={faSass} size="2x" />
      </div>
      <div className={styles.skills__icon_list}>
        <FontAwesomeIcon icon={faJsSquare} size="2x" />
      </div>
      <div className={styles.skills__icon_list}>
        <FontAwesomeIcon icon={faGithubSquare} size="2x" />
      </div>
      <div className={styles.skills__icon_list}>
        <FontAwesomeIcon icon={faReact} size="2x" />
      </div>
      <div className={styles.skills__icon_list}>
        <FontAwesomeIcon icon={faJava} size="2x" />
      </div>
      <div className={styles.skills__icon_list}>
        <img src={spring} height="30" className={styles.skills__icon_img}></img>
      </div>
      {/* <div className={styles.skills_list_icon}>
      <FontAwesomeIcon icon={faJava} size="4x" />
      </div> */}
    </div>
  );
};
